        <http://www.w3.org/2001/XMLSchema#> .\n\n<http://qudt.org/2.1/vocab/quantitykind>\n
        \ a owl:Ontology ;\n  vaem:hasGraphMetadata vaem:GMD_QUDT-QUANTITY-KINDS-ALL
        ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label
        \"QUDT VOCAB Quantity Kinds  Release 2.1.16\" ;\n  owl:imports <http://qudt.org/2.1/schema/qudt>
        ;\n  owl:imports <http://qudt.org/2.1/vocab/dimensionvector> ;\n  owl:versionIRI
        <http://qudt.org/2.1/vocab/quantitykind> ;\n.\nquantitykind:AbsoluteActivity\n
        \ a qudt:QuantityKind ;\n  dcterms:description \"The \\\"Absolute Activity\\\"
        is the exponential of the ratio of the chemical potential to \\\\(RT\\\\)
        where \\\\(R\\\\) is the gas constant and \\\\(T\\\\) the thermodynamic temperature.\"^^qudt:LatexString
        ;\n  qudt:applicableUnit unit:BQ-SEC-PER-M3 ;\n  qudt:hasDimensionVector qkdv:A0E0L-3I0M0H0T0D0
        ;\n  qudt:informativeReference \"http://goldbook.iupac.org/A00019.html\"^^xsd:anyURI
        ;\n  qudt:isoNormativeReference \"http://www.iso.org/iso/catalogue_detail?csnumber=31894\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(\\\\lambda_B = e^{\\\\frac{\\\\mu_B}{RT}}\\\\),
        where \\\\(\\\\mu_B\\\\) is the chemical potential of substance \\\\(B\\\\),
        \\\\(R\\\\) is the molar gas constant, and \\\\(T\\\\) is thermodynamic temperature.\"^^qudt:LatexString
        ;\n  qudt:latexSymbol \"\\\\(\\\\lambda_B\\\\)\"^^qudt:LatexString ;\n  rdfs:isDefinedBy
        <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label \"Absolute Activity\"@en
        ;\n  skos:broader quantitykind:InverseVolume ;\n.\nquantitykind:AbsoluteHumidity\n
        \ a qudt:QuantityKind ;\n  dcterms:description \"\\\"Absolute Humidity\\\"
        is an amount of water vapor, usually discussed per unit volume. Absolute humidity
        in air ranges from zero to roughly 30 grams per cubic meter when the air is
        saturated at \\\\(30 ^\\\\circ C\\\\). The absolute humidity changes as air
        temperature or pressure changes. This is very inconvenient for chemical engineering
        calculations, e.g. for clothes dryers, where temperature can vary considerably.
        As a result, absolute humidity is generally defined in chemical engineering
        as mass of water vapor per unit mass of dry air, also known as the mass mixing
        ratio, which is much more rigorous for heat and mass balance calculations.
        Mass of water per unit volume as in the equation above would then be defined
        as volumetric humidity. Because of the potential confusion.\"^^qudt:LatexString
        ;\n  qudt:applicableUnit unit:GRAIN-PER-GAL ;\n  qudt:applicableUnit unit:KiloGM-PER-M3
        ;\n  qudt:applicableUnit unit:LB-PER-FT3 ;\n  qudt:applicableUnit unit:LB-PER-GAL
        ;\n  qudt:applicableUnit unit:LB-PER-GAL_UK ;\n  qudt:applicableUnit unit:LB-PER-GAL_US
        ;\n  qudt:applicableUnit unit:LB-PER-IN3 ;\n  qudt:applicableUnit unit:LB-PER-M3
        ;\n  qudt:applicableUnit unit:LB-PER-YD3 ;\n  qudt:applicableUnit unit:MilliGM-PER-DeciL
        ;\n  qudt:applicableUnit unit:OZ-PER-GAL ;\n  qudt:applicableUnit unit:OZ-PER-IN3
        ;\n  qudt:applicableUnit unit:PlanckDensity ;\n  qudt:applicableUnit unit:SLUG-PER-FT3
        ;\n  qudt:applicableUnit unit:TON_LONG-PER-YD3 ;\n  qudt:applicableUnit unit:TON_SHORT-PER-YD3
        ;\n  qudt:hasDimensionVector qkdv:A0E0L-3I0M1H0T0D0 ;\n  qudt:informativeReference
        \"http://en.wikipedia.org/wiki/Humidity\"^^xsd:anyURI ;\n  qudt:informativeReference
        \"http://en.wikipedia.org/wiki/Humidity#Absolute_humidity\"^^xsd:anyURI ;\n
        \ qudt:isoNormativeReference \"http://www.iso.org/iso/catalogue_detail?csnumber=31890\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\"\"\\\\(AH = \\\\frac{\\\\mathcal{M}_\\\\omega}{\\\\vee_{net}}\\\\),\nwhere
        \\\\(\\\\mathcal{M}_\\\\omega\\\\) is the mass of water vapor per unit volume
        of total air and \\\\(\\\\vee_{net}\\\\) is water vapor mixture.\"\"\"^^qudt:LatexString
        ;\n  qudt:symbol \"AH\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
        ;\n  rdfs:label \"Absolute Humidity\"@en ;\n  rdfs:seeAlso quantitykind:RelativeHumidity
        ;\n  skos:broader quantitykind:Density ;\n.\nquantitykind:AbsorbedDose\n  a
        qudt:QuantityKind ;\n  dcterms:description \"\\\"Absorbed Dose\\\" (also known
        as Total Ionizing Dose, TID) is a measure of the energy deposited in a medium
        by ionizing radiation. It is equal to the energy deposited per unit mass of
        medium, and so has the unit \\\\(J/kg\\\\), which is given the special name
        Gray (\\\\(Gy\\\\)).\"^^qudt:LatexString ;\n  qudt:applicableUnit unit:GRAY
        ;\n  qudt:applicableUnit unit:MicroGRAY ;\n  qudt:applicableUnit unit:MilliGRAY
        ;\n  qudt:applicableUnit unit:RAD_R ;\n  qudt:dbpediaMatch \"http://dbpedia.org/resource/Absorbed_dose\"^^xsd:anyURI
        ;\n  qudt:hasDimensionVector qkdv:A0E0L2I0M0H0T-2D0 ;\n  qudt:informativeReference
        \"http://en.wikipedia.org/wiki/Absorbed_dose\"^^xsd:anyURI ;\n  qudt:isoNormativeReference
        \"http://www.iso.org/iso/catalogue_detail?csnumber=31895\"^^xsd:anyURI ;\n
        \ qudt:latexDefinition \"\\\\(D = \\\\frac{d\\\\bar{\\\\varepsilon}}{dm}\\\\),
        where \\\\(d\\\\bar{\\\\varepsilon}\\\\) is the mean energy imparted by ionizing
        radiation to an element of irradiated matter with the mass \\\\(dm\\\\).\"^^qudt:LatexString
        ;\n  qudt:symbol \"D\" ;\n  rdfs:comment \"Note that the absorbed dose is
        not a good indicator of the likely biological effect. 1 Gy of alpha radiation
        would be much more biologically damaging than 1 Gy of photon radiation for
        example. Appropriate weighting factors can be applied reflecting the different
        relative biological effects to find the equivalent dose. The risk of stoctic
        effects due to radiation exposure can be quantified using the effective dose,
        which is a weighted average of the equivalent dose to each organ depending
        upon its radiosensitivity. When ionising radiation is used to treat cancer,
        the doctor will usually prescribe the radiotherapy treatment in Gy. When risk
        from ionising radiation is being discussed, a related unit, the Sievert is
        used.\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind> ;\n
        \ rdfs:label \"Absorbed Dose\"@en ;\n  skos:broader quantitykind:SpecificEnergy
        ;\n.\nquantitykind:AbsorbedDoseRate\n  a qudt:QuantityKind ;\n  qudt:applicableUnit
        unit:ERG-PER-GM-SEC ;\n  qudt:applicableUnit unit:GRAY-PER-SEC ;\n  qudt:applicableUnit
        unit:W-PER-KiloGM ;\n  qudt:baseUnitDimensions \"\\\\(L^2/T^3\\\\)\"^^qudt:LatexString
        ;\n  qudt:baseUnitDimensions \"\\\\(m^2/s^3\\\\)\"^^qudt:LatexString ;\n  qudt:hasDimensionVector
        qkdv:A0E0L2I0M0H0T-3D0 ;\n  qudt:informativeReference \"http://www.answers.com/topic/absorbed-dose-rate\"^^xsd:anyURI
        ;\n  qudt:isoNormativeReference \"http://www.iso.org/iso/catalogue_detail?csnumber=31895\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(\\\\dot{D} = \\\\frac{dD}{dt}\\\\), where
        \\\\(dD\\\\) is the increment of absorbed dose during time interval with duration
        \\\\(dt\\\\).\"^^qudt:LatexString ;\n  qudt:latexSymbol \"\\\\(\\\\dot{D}\\\\)\"^^qudt:LatexString
        ;\n  qudt:plainTextDescription \"\\\"Absorbed Dose Rate\\\" is the absorbed
        dose of ionizing radiation imparted at a given location per unit of time (second,
        minute, hour, or day).\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
        ;\n  rdfs:label \"Absorbed Dose Rate\"@en ;\n.\nquantitykind:Absorptance\n
        \ a qudt:QuantityKind ;\n  qudt:applicableUnit unit:UNITLESS ;\n  qudt:hasDimensionVector
        qkdv:A0E0L0I0M0H0T0D1 ;\n  qudt:informativeReference \"https://en.wikipedia.org/wiki/Absorptance\"^^xsd:anyURI
        ;\n  qudt:informativeReference \"https://www.researchgate.net/post/Absorptance_or_absorbance\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(\\\\alpha = \\\\frac{\\\\Phi_a}{\\\\Phi_m}\\\\),
        where \\\\(\\\\Phi_a\\\\) is the absorbed radiant flux or the absorbed luminous
        flux, and \\\\(\\\\Phi_m\\\\) is the radiant flux or luminous flux of the
        incident radiation.\"^^qudt:LatexString ;\n  qudt:latexSymbol \"\\\\(\\\\alpha\\\\)\"^^qudt:LatexString
        ;\n  qudt:plainTextDescription \"Absorptance is the ratio of the radiation
        absorbed by a surface to that incident upon it. Also known as absorbance.\"
        ;\n  qudt:systemDerivedQuantityKind qudt:SOQ_SI ;\n  vaem:todo \"belongs to
        SOQ-ISO\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind> ;\n
        \ rdfs:label \"Absorptance\"@en ;\n  skos:exactMatch <http://en.wikipedia.org/wiki/Absorbance>
        ;\n.\nquantitykind:Acceleration\n  a qudt:QuantityKind ;\n  dcterms:description
        \"Acceleration is the (instantaneous) rate of change of velocity. Acceleration
        may be either linear acceleration, or angular acceleration. It is a vector
        quantity with dimension \\\\(length/time^{2}\\\\) for linear acceleration,
        or in the case of angular acceleration, with dimension \\\\(angle/time^{2}\\\\).
        In SI units, linear acceleration is measured in \\\\(meters/second^{2}\\\\)
        (\\\\(m \\\\cdot s^{-2}\\\\)) and angular acceleration is measured in \\\\(radians/second^{2}\\\\).
        In physics, any increase or decrease in speed is referred to as acceleration
        and similarly, motion in a circle at constant speed is also an acceleration,
        since the direction component of the velocity is changing.\"^^qudt:LatexString
        ;\n  qudt:applicableUnit unit:CentiM-PER-SEC2 ;\n  qudt:applicableUnit unit:FT-PER-SEC2
        ;\n  qudt:applicableUnit unit:G ;\n  qudt:applicableUnit unit:GALILEO ;\n
        \ qudt:applicableUnit unit:IN-PER-SEC2 ;\n  qudt:applicableUnit unit:KN-PER-SEC
        ;\n  qudt:applicableUnit unit:KiloPA-M2-PER-GM ;\n  qudt:applicableUnit unit:M-PER-SEC2
        ;\n  qudt:applicableUnit unit:MicroG ;\n  qudt:applicableUnit unit:MilliG
        ;\n  qudt:applicableUnit unit:MilliGAL ;\n  qudt:dbpediaMatch \"http://dbpedia.org/resource/Acceleration\"^^xsd:anyURI
        ;\n  qudt:hasDimensionVector qkdv:A0E0L1I0M0H0T-2D0 ;\n  qudt:informativeReference
        \"http://en.wikipedia.org/wiki/Acceleration\"^^xsd:anyURI ;\n  rdfs:isDefinedBy
        <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label \"Acceleration\"@en
        ;\n  owl:sameAs quantitykind:LinearAcceleration ;\n.\nquantitykind:AccelerationOfGravity\n
        \ a qudt:QuantityKind ;\n  qudt:applicableUnit unit:CentiM-PER-SEC2 ;\n  qudt:applicableUnit
