        through which an acoustic wave of frequence \\\\(f\\\\) propagates.\"^^qudt:LatexString
        ;\n  qudt:plainTextDescription \"Acoustic impedance at a surface is the complex
        quotient of the average sound pressure over that surface by the sound volume
        flow rate through that surface.\" ;\n  qudt:symbol \"Z\" ;\n  rdfs:isDefinedBy
        <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label \"Acoustic Impediance\"@en
        ;\n.\nquantitykind:Action\n  a qudt:QuantityKind ;\n  qudt:applicableUnit
        unit:AttoJ-SEC ;\n  qudt:applicableUnit unit:J-SEC ;\n  qudt:hasDimensionVector
        qkdv:A0E0L2I0M1H0T-1D0 ;\n  qudt:informativeReference \"http://en.wikipedia.org/wiki/Action_(physics)\"^^xsd:anyURI
        ;\n  qudt:isoNormativeReference \"http://www.iso.org/iso/catalogue_detail?csnumber=31889\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(S = \\\\int Ldt\\\\), where \\\\(L\\\\) is
        the Lagrange function and \\\\(t\\\\) is time.\"^^qudt:LatexString ;\n  qudt:plainTextDescription
        \"\"\"An action is usually an integral over time. But for action pertaining
        to fields, it may be integrated over spatial variables as well. In some cases,
        the action is integrated along the path followed by the physical system.  If
        the action is represented as an integral over time, taken a the path of the
        system between the initial time and the final time of the development of the
        system.\nThe evolution of a physical system between two states is determined
        by requiring the action be minimized or, more generally, be stationary for
        small perturbations about the true evolution. This requirement leads to differential
        equations that describe the true evolution. Conversely, an action principle
        is a method for reformulating differential equations of motion for a physical
        system as an equivalent integral equation. Although several variants have
        been defined (see below), the most commonly used action principle is Hamilton's
        principle.\"\"\" ;\n  qudt:symbol \"S\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
