        \"\\\\(A/m^2\\\\)\"^^qudt:LatexString ;\n  qudt:baseUnitDimensions \"\\\\(I/L^2\\\\)\"^^qudt:LatexString
        ;\n  qudt:dbpediaMatch \"http://dbpedia.org/resource/Current_density\"^^xsd:anyURI
