        ;\n  rdfs:label \"Electric Current per Unit Length\"@en ;\n.\nquantitykind:ElectricCurrentPerUnitTemperature\n
        \ a qudt:QuantityKind ;\n  qudt:applicableUnit unit:A-PER-DEG_C ;\n  qudt:hasDimensionVector
