        ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind/all> ;\n  rdfs:label
        \"Electric Current per Unit Temperature\"@en ;\n.\nquantitykind:ElectricCurrentPhasor\n
