        qkdv:A0E1L0I0M0H0T0D0 ;\n  qudt:informativeReference \"http://en.wikipedia.org/wiki/Phasor_(electronics)\"^^xsd:anyURI
        ;\n  qudt:informativeReference \"http://www.electropedia.org/iev/iev.nsf/display?openform&ievref=131-11-26\"^^xsd:anyURI
        ;\n  qudt:informativeReference \"http://www.iso.org/iso/home/store/catalogue_tc/catalogue_detail.htm?csnumber=31891\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"When \\\\(i = \\\\hat{I} \\\\cos{(\\\\omega t
