        unit:Debye ;\n  qudt:baseUnitDimensions \"\\\\(A \\\\cdot m \\\\cdot s\\\\)\"^^qudt:LatexString
        ;\n  qudt:baseUnitDimensions \"\\\\(I \\\\cdot L \\\\cdot T\\\\)\"^^qudt:LatexString
        ;\n  qudt:hasDimensionVector qkdv:A0E1L1I0M0H0T1D0 ;\n  qudt:informativeReference
