        \"http://www.iso.org/iso/home/store/catalogue_tc/catalogue_detail.htm?csnumber=31891\"^^xsd:anyURI
        ;\n  qudt:isoNormativeReference \"http://www.iso.org/iso/catalogue_detail?csnumber=31894\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\"\"\\\\(E_p = -p \\\\cdot E\\\\), where \\\\(E_p\\\\)
        is the interaction energy of the molecule with electric dipole moment \\\\(p\\\\)
        and an electric field with electric field strength \\\\(E\\\\).\n\n\\\\(p
        = q(r_+ - r_i)\\\\), where \\\\(r_+\\\\) and \\\\(r_-\\\\) are the position
        vectors to carriers of electric charge \\\\(a\\\\) and \\\\(-q\\\\), respectively.\"\"\"^^qudt:LatexString
        ;\n  qudt:plainTextDescription \"\\\"Electric Dipole Moment\\\" is a measure
        of the separation of positive and negative electrical charges in a system
        of (discrete or continuous) charges. It is a vector-valued quantity. If the
        system of charges is neutral, that is if the sum of all charges is zero, then
        the dipole moment of the system is independent of the choice of a reference
        frame; however in a non-neutral system, such as the dipole moment of a single
        proton, a dependence on the choice of reference point arises. In such cases
        it is conventional to choose the reference point to be the center of mass
        of the system or the center of charge, not some arbitrary origin. This convention
        ensures that the dipole moment is an intrinsic property of the system. The
        electric dipole moment of a substance within a domain is the vector sum of
        electric dipole moments of all electric dipoles included in the domain.\"
        ;\n  qudt:symbol \"p\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
        ;\n  rdfs:label \"Electric Dipole Moment\"@en ;\n.\nquantitykind:ElectricDisplacement\n
