        \\\\cdot m/A \\\\cdot s^3\\\\)\"^^qudt:LatexString ;\n  qudt:dbpediaMatch
        \"http://dbpedia.org/resource/Electric_field\"^^xsd:anyURI ;\n  qudt:expression
        \"\\\\(E\\\\)\"^^qudt:LatexString ;\n  qudt:hasDimensionVector qkdv:A0E-1L1I0M1H0T-3D0
        ;\n  qudt:informativeReference \"http://en.wikipedia.org/wiki/Electric_field\"^^xsd:anyURI
        ;\n  qudt:plainTextDescription \"The space surrounding an electric charge
        or in the presence of a time-varying magnetic field has a property called
        an electric field. This electric field exerts a force on other electrically
        charged objects. In the idealized case, the force exerted between two point
        charges is inversely proportional to the square of the distance between them.
