        ;\n  rdfs:label \"Electric Field\"@en ;\n.\nquantitykind:ElectricFieldStrength\n
        \ a qudt:QuantityKind ;\n  dcterms:description \"\\\\(\\\\textbf{Electric
        Field Strength}\\\\) is the magnitude and direction of an electric field,
        expressed by the value of \\\\(E\\\\), also referred to as \\\\(\\\\color{indigo}
        {\\\\textit{electric field intensity}}\\\\) or simply the electric field.\"^^qudt:LatexString
        ;\n  qudt:applicableUnit unit:KiloV-PER-M ;\n  qudt:applicableUnit unit:MegaV-PER-M
        ;\n  qudt:applicableUnit unit:MicroV-PER-M ;\n  qudt:applicableUnit unit:MilliV-PER-M
