        \"http://www.iso.org/iso/home/store/catalogue_tc/catalogue_detail.htm?csnumber=31891\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(\\\\mathbf{E} = \\\\mathbf{F}/q\\\\), where
        \\\\(\\\\mathbf{F}\\\\) is force and \\\\(q\\\\) is electric charge, of a
        test particle at rest.\"^^qudt:LatexString ;\n  qudt:latexSymbol \"\\\\(\\\\mathbf{E}
        \\\\)\"^^qudt:LatexString ;\n  qudt:symbol \"E\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
        ;\n  rdfs:label \"Electric Field Strength\"@en ;\n.\nquantitykind:ElectricFlux\n
        \ a qudt:QuantityKind ;\n  qudt:applicableUnit unit:V-M ;\n  qudt:applicableUnit
