        ;\n.\nquantitykind:ElectricFluxDensity\n  a qudt:QuantityKind ;\n  dcterms:description
        \"\\\\(\\\\textbf{Electric Flux Density}\\\\), also referred to as \\\\(\\\\textit{Electric
        Displacement}\\\\), is related to electric charge density by the following
        equation: \\\\(\\\\text{div} \\\\; D = \\\\rho\\\\), where \\\\(\\\\text{div}\\\\)
        denotes the divergence.\"^^qudt:LatexString ;\n  qudt:applicableUnit unit:C-PER-CentiM2
        ;\n  qudt:applicableUnit unit:C-PER-M2 ;\n  qudt:applicableUnit unit:C-PER-MilliM2
        ;\n  qudt:applicableUnit unit:C_Ab-PER-CentiM2 ;\n  qudt:applicableUnit unit:C_Stat-PER-CentiM2
        ;\n  qudt:applicableUnit unit:KiloC-PER-M2 ;\n  qudt:applicableUnit unit:MegaC-PER-M2
        ;\n  qudt:applicableUnit unit:MicroC-PER-M2 ;\n  qudt:applicableUnit unit:MilliC-PER-M2
        ;\n  qudt:dbpediaMatch \"http://dbpedia.org/resource/Electric_flux\"^^xsd:anyURI
        ;\n  qudt:hasDimensionVector qkdv:A0E1L-2I0M0H0T1D0 ;\n  qudt:informativeReference
        \"http://www.iso.org/iso/home/store/catalogue_tc/catalogue_detail.htm?csnumber=31891\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(\\\\mathbf{D}  = \\\\epsilon_0 E + P\\\\),
        where \\\\(\\\\epsilon_0\\\\) is the electric constant, \\\\(\\\\mathbf{E}
        \\\\) is electric field strength, and \\\\(P\\\\) is electric polarization.\"^^qudt:LatexString
        ;\n  qudt:latexSymbol \"\\\\(\\\\mathbf{D}\\\\)\"^^qudt:LatexString ;\n  rdfs:isDefinedBy
        <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label \"Electric Flux Density\"@en
        ;\n  owl:sameAs quantitykind:ElectricDisplacement ;\n  skos:broader quantitykind:ElectricChargePerArea
        ;\n.\nquantitykind:ElectricPolarizability\n  a qudt:QuantityKind ;\n  qudt:applicableUnit
        unit:J-PER-MOL ;\n  qudt:hasDimensionVector qkdv:A-1E0L2I0M1H0T-2D0 ;\n  qudt:informativeReference
        \"http://en.wikipedia.org/wiki/Polarizability\"^^xsd:anyURI ;\n  qudt:isoNormativeReference
        \"http://www.iso.org/iso/catalogue_detail?csnumber=31894\"^^xsd:anyURI ;\n
        \ qudt:latexDefinition \"\\\\(\\\\alpha_{i,j} = \\\\frac{\\\\partial p_i}{\\\\partial
        E_j}\\\\), where \\\\(p_i\\\\) is the cartesian component along the \\\\(i-axis\\\\)
        of the electric dipole moment induced by the applied electric field strength
        acting on the molecule, and \\\\(E_j\\\\) is the component along the \\\\(j-axis\\\\)
        of this electric field strength.\"^^qudt:LatexString ;\n  qudt:latexSymbol
        \"\\\\(\\\\alpha\\\\)\"^^qudt:LatexString ;\n  qudt:plainTextDescription \"\\\"Electric
        Polarizability\\\" is the relative tendency of a charge distribution, like
        the electron cloud of an atom or molecule, to be distorted from its normal
        shape by an external electric field, which is applied typically by inserting
        the molecule in a charged parallel-plate capacitor, but may also be caused
        by the presence of a nearby ion or dipole.\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
        ;\n  rdfs:label \"Electric Polarizability\"@en ;\n.\nquantitykind:ElectricPolarization\n
