        unit:KiloC-PER-M2 ;\n  qudt:hasDimensionVector qkdv:A0E1L-2I0M0H0T1D0 ;\n
        \ qudt:informativeReference \"http://www.britannica.com/EBchecked/topic/182690/electric-polarization\"^^xsd:anyURI
        ;\n  qudt:informativeReference \"http://www.iso.org/iso/home/store/catalogue_tc/catalogue_detail.htm?csnumber=31891\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(P =\\\\frac{dp}{dV}\\\\), where \\\\(p\\\\)
        is electic charge density and \\\\(V\\\\) is volume.\"^^qudt:LatexString ;\n
        \ qudt:plainTextDescription \"\\\"Electric Polarization\\\" is the relative
        shift of positive and negative electric charge in opposite directions within
        an insulator, or dielectric, induced by an external electric field. Polarization
        occurs when an electric field distorts the negative cloud of electrons around
        positive atomic nuclei in a direction opposite the field. This slight separation
        of charge makes one side of the atom somewhat positive and the opposite side
        somewhat negative. In some materials whose molecules are permanently polarized
        by chemical forces, such as water molecules, some of the polarization is caused
        by molecules rotating into the same alignment under the influence of the electric
        field. One of the measures of polarization is electric dipole moment, which
        equals the distance between the slightly shifted centres of positive and negative
        charge multiplied by the amount of one of the charges. Polarization P in its
        quantitative meaning is the amount of dipole moment p per unit volume V of
        a polarized material, P = p/V.\" ;\n  qudt:symbol \"P\" ;\n  rdfs:isDefinedBy
        <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label \"Electric Polarization\"@en
        ;\n  rdfs:seeAlso quantitykind:ElectricChargeDensity ;\n  rdfs:seeAlso quantitykind:ElectricDipoleMoment
        ;\n.\nquantitykind:ElectricPotential\n  a qudt:QuantityKind ;\n  dcterms:description
        \"The Electric Potential is a scalar valued quantity associated with an electric
        field. The electric potential \\\\(\\\\phi(x)\\\\) at a point, \\\\(x\\\\),
        is formally defined as the line integral of the electric field taken along
        a path from x to the point at infinity. If the electric field is static, that
        is time independent, then the choice of the path is arbitrary; however if
        the electric field is time dependent, taking the integral a different paths
        will produce different results.\"^^qudt:LatexString ;\n  qudt:applicableUnit
        unit:KiloV ;\n  qudt:applicableUnit unit:MegaV ;\n  qudt:applicableUnit unit:MicroV
        ;\n  qudt:applicableUnit unit:MilliV ;\n  qudt:applicableUnit unit:PlanckVolt
        ;\n  qudt:applicableUnit unit:V ;\n  qudt:applicableUnit unit:V_Ab ;\n  qudt:applicableUnit
        unit:V_Stat ;\n  qudt:hasDimensionVector qkdv:A0E-1L2I0M1H0T-3D0 ;\n  qudt:informativeReference
        \"http://www.iso.org/iso/home/store/catalogue_tc/catalogue_detail.htm?csnumber=31891\"^^xsd:anyURI
        ;\n  qudt:isoNormativeReference \"http://www.iso.org/iso/catalogue_detail?csnumber=43012\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(-\\\\textbf{grad} \\\\; V = E + \\\\frac{\\\\partial
        A}{\\\\partial t}\\\\), where \\\\(E\\\\) is electric field strength, \\\\(A\\\\)
        is magentic vector potential and \\\\(t\\\\) is time.\"^^qudt:LatexString
        ;\n  qudt:latexSymbol \"\\\\(\\\\phi\\\\)\"^^qudt:LatexString ;\n  qudt:symbol
        \"V\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label
        \"Electric Potential\"@en ;\n  owl:sameAs quantitykind:EnergyPerElectricCharge
        ;\n  skos:broader quantitykind:EnergyPerElectricCharge ;\n.\nquantitykind:ElectricPotentialDifference\n
        \ a qudt:QuantityKind ;\n  qudt:applicableUnit unit:KiloV ;\n  qudt:applicableUnit
        unit:MegaV ;\n  qudt:applicableUnit unit:MicroV ;\n  qudt:applicableUnit unit:MilliV
        ;\n  qudt:applicableUnit unit:PlanckVolt ;\n  qudt:applicableUnit unit:V ;\n
        \ qudt:applicableUnit unit:V_Ab ;\n  qudt:applicableUnit unit:V_Stat ;\n  qudt:hasDimensionVector
        qkdv:A0E-1L2I0M1H0T-3D0 ;\n  qudt:informativeReference \"http://www.iso.org/iso/home/store/catalogue_tc/catalogue_detail.htm?csnumber=31891\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\\\\(V_{ab} = \\\\int_{r_a(C)}^{r_b} (E +\\\\frac{\\\\partial
        A}{\\\\partial t}) \\\\), where \\\\(E\\\\) is electric field strength, \\\\(A\\\\)
        is magentic vector potential,  \\\\(t\\\\) is time, and \\\\(r\\\\) is position
        vector along a curve C from a point \\\\(a\\\\) to \\\\(b\\\\).\"^^qudt:LatexString
        ;\n  qudt:plainTextDescription \"\\\"Electric Potential Difference\\\" is
