        ;\n  qudt:latexDefinition \"\\\\(\\\\epsilon = \\\\frac{D}{E}\\\\), where
        \\\\(D\\\\) is electric flux density and \\\\(E\\\\) is electric field strength.\"^^qudt:LatexString
        ;\n  qudt:latexSymbol \"\\\\(\\\\epsilon\\\\)\"^^qudt:LatexString ;\n  qudt:plainTextDescription
        \"\\\"Permittivity\\\" is a physical quantity that describes how an electric
