        ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind> ;\n  rdfs:label
        \"Permittivity\"@en ;\n.\nquantitykind:PhaseCoefficient\n  a qudt:QuantityKind
        ;\n  dcterms:description \"The phase coefficient is the amount of phase shift
        that occurs as the wave travels one meter. Increasing the loss of the material,
        via the manipulation of the material's conductivity, will decrease the wavelength
        (increase \\\\(\\\\beta\\\\)) and increase the attenuation coefficient (increase
        \\\\(\\\\alpha\\\\)).\"^^qudt:LatexString ;\n  qudt:applicableUnit unit:PER-M
        ;\n  qudt:hasDimensionVector qkdv:A0E0L-1I0M0H0T0D0 ;\n  qudt:informativeReference
        \"http://en.wikipedia.org/wiki/Attenuation_coefficient\"^^xsd:anyURI ;\n  qudt:latexDefinition
        \"If \\\\(F(x) = Ae^{-\\\\alpha x} \\\\cos{[\\\\beta (x - x_0)]}\\\\), then
        \\\\(\\\\alpha\\\\) is the attenuation coefficient and \\\\(\\\\beta\\\\)
        is the phase coefficient.\"^^qudt:LatexString ;\n  qudt:latexSymbol \"\\\\(\\\\beta\\\\)\"^^qudt:LatexString
        ;\n  vaem:todo \"belongs to SOQ-ISO\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
        ;\n  rdfs:label \"Phase coefficient\"@en ;\n.\nquantitykind:PhaseDifference\n
