        and the oscillators are said to be out of phase with each other. The amount
        by which such oscillators are out of step with each other can be expressed
        in degrees from \\\\SI{0}{\\\\degree} to \\\\SI{360}{\\\\degree}, or in radians
        from 0 to \\\\num{2\\\\pi\\\". If the phase difference is 180 degrees (\\\\(\\\\pi\\\\)
        radians), then the two oscillators are said to be in antiphase.\"^^qudt:LatexString
        ;\n  qudt:expression \"\\\\(phase-difference\\\\)\"^^qudt:LatexString ;\n
        \ qudt:informativeReference \"http://en.wikipedia.org/wiki/Phase_(waves)#Phase_difference\"^^xsd:anyURI
        ;\n  qudt:informativeReference \"http://www.electropedia.org/iev/iev.nsf/display?openform&ievref=103-07-06\"^^xsd:anyURI
