        is the initial phase of the electric current.\"^^qudt:LatexString ;\n  qudt:latexSymbol
        \"\\\\(\\\\varphi\\\\)\"^^qudt:LatexString ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
        ;\n  rdfs:label \"Phase Difference\"@en ;\n.\nquantitykind:PhaseSpeedOfSound\n
        \ a qudt:QuantityKind ;\n  qudt:applicableUnit unit:GigaHZ-M ;\n  qudt:applicableUnit
        unit:KiloHZ-M ;\n  qudt:hasDimensionVector qkdv:A0E0L1I0M0H0T-1D0 ;\n  qudt:informativeReference
        \"http://en.wikipedia.org/wiki/Speed_of_sound\"^^xsd:anyURI ;\n  qudt:latexDefinition
        \"\\\\(c = \\\\frac{\\\\omega}{k} = \\\\lambda f\\\\), where \\\\(\\\\omega\\\\)
        is the angular frequency, \\\\(k\\\\) is angular wavenumber, \\\\(\\\\lambda\\\\)
