        \ a qudt:QuantityKind ;\n  dcterms:description \"The \\\\(\\\\textit{Planck
        function}\\\\) is used to compute the radiance emitted from objects that radiate
        like a perfect \\\"Black Body\\\". The inverse of the \\\\(\\\\textit{Planck
        Function}\\\\) is used to find the \\\\(\\\\textit{Brightness Temperature}\\\\)
        of an object. The precise formula for the Planck Function depends on whether
        the radiance is determined on a \\\\(\\\\textit{per unit wavelength}\\\\)
        or a \\\\(\\\\textit{per unit frequency}\\\\). In the ISO System of Quantities,
        \\\\(\\\\textit{Planck Function}\\\\) is defined by the formula: \\\\(Y =
