        ;\n  qudt:isoNormativeReference \"http://www.iso.org/iso/catalogue_detail?csnumber=31890\"^^xsd:anyURI
        ;\n  qudt:latexDefinition \"\"\"The Planck function, \\\\(B_{\\\\tilde{\\\\nu}}(T)\\\\),
