        \"http://en.wikipedia.org/wiki/Turbidity\"^^xsd:anyURI ;\n  qudt:plainTextDescription
        \"Turbidity is the cloudiness or haziness of a fluid, or of air, caused by
        individual particles (suspended solids) that are generally invisible to the
        naked eye, similar to smoke in air. Turbidity in open water is often caused
        by phytoplankton and the measurement of turbidity is a key test of water quality.
        The higher the turbidity, the higher the risk of the drinkers developing gastrointestinal
        diseases, especially for immune-compromised people, because contaminants like
        virus or bacteria can become attached to the suspended solid. The suspended
        solids interfere with water disinfection with chlorine because the particles
        act as shields for the virus and bacteria. Similarly suspended solids can
        protect bacteria from UV sterilisation of water. Fluids can contain suspended
        solid matter consisting of particles of many different sizes. While some suspended
        material will be large enough and heavy enough to settle rapidly to the bottom
        container if a liquid sample is left to stand (the settleable solids), very
        small particles will settle only very slowly or not at all if the sample is
        regularly agitated or the particles are colloidal. These small solid particles
        cause the liquid to appear turbid.\" ;\n  rdfs:isDefinedBy <http://qudt.org/2.1/vocab/quantitykind>
