        of a system to do work due to its position or internal structure. Change in
        potential energy is equal to work. The potential energy equations can also
        be derived from the integral form of work, \\\\(\\\\Delta P. E. = W = \\\\int
        \ F \\\\cdot dx\\\\).\"^^qudt:LatexString ;\n  qudt:applicableUnit unit:AttoJ
